import React from 'react';
import { FaBriefcase, FaGraduationCap, FaHome, FaUser } from 'react-icons/fa';
import './Style.css';

function NavigationItems() {

    const getClickeditem = e => {
        console.log(e.target.dataset.item); 
    }

    // useEffect(() => {
    //     var list = document.getElementById("nav_items");
    //     var items = list.getElementsByTagName("li");
        
    //     for (var i = 0; i < items.length; i++) {
    //         console.log(items[i].id);
    //     }
    // })

    return (
        <ul className="navigation" id="nav_items">
            <li data-item="home" onClick={getClickeditem.bind(this)}><FaHome size={32} data-item="home" color={"#2c4269"}/></li>
            <li data-item="aboutme"><FaUser size={32} color={"#2c4269"}/></li>
            <li data-item="education"><FaGraduationCap size={32} color={"#2c4269"}/></li>
            <li data-item="work"><FaBriefcase size={32} color={"#2c4269"}/></li>
        </ul>   
    );
}

export default NavigationItems;
